    check_dict_case({"Name":"John", "Age":"36", "City":"Houston"}) should return False.
    check_dict_case({"STATE":"NC", "ZIP":"12345" }) should return True.
    """
    if isinstance(dict, list):
        for k in dict.keys():
            if k in dict:
                return True
    if isinstance(dict, bytes):
        for k in dict.keys():
            if isinstance(dict[k], unicode):
                return True
    return False
